import React from 'react'
import test from '../Images/bg1.jpeg'
export const Card = ({ getAnime }) => {
    console.log(getAnime);
    return (
        <div className='flex juis'>
            <div className='grid grid-cols-1 content-start items-center justify-center'>

                {getAnime.map((res, key) => {
                    return (
                        <div className='text-white max-w-[230px] bg-indigo-900' key={key}>
                            <img src={res.images.jpg.image_url} alt="" />
                            <div>
                                <p>Title: {res.title}</p>
                                <p>Studios: {res.studios.name}</p>
                                <p>Score : {res.score}</p>
                                    {res.genres.map((res, key) => {
                                        return (
                                            <span className='datagenders' key={key}> {res.name} </span>
                                        )
                                    })}
                                    {res.producers.map((res, key) => {
                                        return (
                                            <span className='datalist' key={key}> {res.name} </span>
                                        )
                                    })}
                            </div>
                        </div>
                    )
                })}

            </div>
        </div>
    )
}
